import React from "react";
import QnA from "./components/qna";

import AllQnAs from "./data";

const QnAGame = () => {
  return (
    <div className="qna-game">
      QnA Game
      <QnA question={AllQnAs[0]} />
    </div>
  );
};

export default QnAGame;
